(1269, '2021-08-11 01:51:52', NULL, NULL, 0, '2021-08-11 05:51:16', NULL, NULL, 0, '2021-08-11 11:15:01', 'งานที่ทำวันนี้\r\n1.Add TM 63 CBR8849A\r\n2.add PBOQ Site CCS1635A ที่แจ้ง ถอย Po\r\n3.ดึงข้อมูล Step ATTS ในระบบ ATTS เพื่ออัพโปรเกรท\r\n4.อัพ step ATTS ในโปรเกรททุกพื้นที่ BMA UPC 1-10\r\n5.อัพ step ATTS งาน TK ทุกพื้นที่\r\n6.ติดตาม Core assign จากทีม design เพื่อแอดเข้าระบบ Porms\r\n7.เช็ค Folw Tams\r\n8.ส่งเมล์ขอเปิด work CTB7217 CTB7214A CTB7216A CTB7221A RYG7953A TRT7171A TRT7172A TRT7173A\r\n9.add pac TICC:U2017711:PRI_1U05:INSTALLATION:20134890 ', '', 0, '', 57),
